function Descriptions({ descriptions })
 {
    return (
      <>
        <div className="info justify-content-center">
            <img src={descriptions.photo} style={{width: 80,}}/>
            <div>
                <h2>Yes!Places</h2>
                <p>Test Description 1</p>
            </div>

            {descriptions.map((descriptions) => (<Description key={descriptions.id} descriptions={descriptions} />))}
        </div>
        
      </>
    );
  }
  
  export default Descriptions;
